    return (
        <Container>
            <Container>
                <div>
                    <h1>Get a wider angle on coderhub.sa</h1>
                </div>
                <hr></hr>
                <img className="shadow-lg" src={home_img} height={500} width={700}></img>
            </Container>
        </Container>
    );
}

export default Welcome;
